import React from 'react';
import MainStyle from './styles/Main';
import styled from 'styled-components';

const Title = styled.h1`
  color: ${(props) => props.theme.primaryDark};
`;

function Main(props) {
  return (
    <MainStyle>
      <Title>Hello</Title>
    </MainStyle>
  );
}

export default Main;
